import React, { useState } from 'react';
import './create.css';

function Create() {
    const [currentImageId, setCurrentImageId] = useState(1);
    const [imageId, setImageId] = useState(`wallpaper ${currentImageId}`);
    const [creatorName, setCreatorName] = useState('');
    const [creatorJob, setCreatorJob] = useState('');
    const [creatorPhoto, setCreatorPhoto] = useState(null);
    
    const generateJSON = () => {
        const imageSrc = `img/wallpapers/${currentImageId}.jfif`;
        const creatorPhotoSrc = `img/profile/${currentImageId}.png`;
        
        const jsonData = {
            id: imageId,
            src: imageSrc,
            creator: {
                src: creatorPhotoSrc,
                name: creatorName,
                job: creatorJob
            }
        };
        
        console.log(jsonData); // You can send this JSON data to your server using fetch or other methods.
        
        setCurrentImageId(currentImageId + 1); // Increment the image ID for the next entry.
        setImageId(`wallpaper ${currentImageId + 1}`);
    };

    return (
  <>
   <div className="create">
        <div className="signup2">
            <div className="overlap-wrapper">
                <div className="overlap">
                   
                    <div className="overlap-group-2">
                        <div className="ellipse" />
                        <div className="ellipse-2" />
                        <div className="frame-wrapper">
                            <div className="frame-2">
                                <div className="frame-3">
                                    <div className="upper-section">
                                        <div className="login-text">
                                            <div className="text-wrapper-2">Upload Image</div>
                                            <p className="p">Add new ART</p>
                                        </div>
                                        <div className="credentials">
                                            <div className="div-wrapper">
                                            <label htmlFor="imageFile" className="text-wrapper-9">Upload Image:</label>
            <input type="file" id="imageFile" name="imageFile" className="text-wrapper-9"/><br /><br />
                                            </div>
                                            <div className="div-wrapper">
                                          
            <input type="text" placeholder="Enter Image Creator Name" id="creatorName" className="text-wrapper-9" name="creatorName" value={creatorName} onChange={(e) => setCreatorName(e.target.value)} /><br /><br />

                                            </div>
                                            <div className="password-rem">
                                                <div className="div-wrapper">
                                                <label htmlFor="creatorPhoto" className="text-wrapper-9">Image Creator Photo:</label>
            <input type="file" id="creatorPhoto" name="creatorPhoto" className="text-wrapper-9" onChange={(e) => setCreatorPhoto(e.target.files[0])} /><br /><br />
                                                </div>
                                                <div className="div-wrapper">
                                              
            <input type="text" id="creatorJob" name="creatorJob"  className="text-wrapper-9" placeholder="Enter Image Creator Job" value={creatorJob} onChange={(e) => setCreatorJob(e.target.value)} /><br /><br />
                                                </div>
                                            </div>
                                            <div className="login-bt-fp">
                                                <div className="login">
                                                <button type="button" className="text-wrapper-11" onClick={generateJSON}>Upload Image</button>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                   
                                </div>
                              
                            </div>
                        </div>
                    </div>
                   
                </div>
            </div>
        </div>
        </div>
               
         

          

          
 

           

          
       </>
    );
}

export default Create;
